CREATE TABLE #temp
(
ID INT IDENTITY CONSTRAINT PK_ID PRIMARY KEY CLUSTERED,
FK_Table NVARCHAR(1000),
FK_Column NVARCHAR(1000),
PK_Table NVARCHAR(1000), 
PK_Column NVARCHAR(1000),
Constraint_Name NVARCHAR(1000)
)
          FK_Column ,
          PK_Table ,
          PK_Column ,
          Constraint_Name
        )
SELECT FK_Table,
		FK_Column,
		PK_Table,
		PK_Column,
		Constraint_Name
FROM (
SELECT
    FK_Table = FK.TABLE_NAME,
    FK_Column = CU.COLUMN_NAME,
    PK_Table = PK.TABLE_NAME,
    PK_Column = PT.COLUMN_NAME,
    Constraint_Name = C.CONSTRAINT_NAME,
	C.DELETE_RULE ,
	LEN(C.CONSTRAINT_NAME) AS FK_Len
FROM
    INFORMATION_SCHEMA.REFERENTIAL_CONSTRAINTS AS C
INNER JOIN INFORMATION_SCHEMA.TABLE_CONSTRAINTS AS FK
    ON C.CONSTRAINT_NAME = FK.CONSTRAINT_NAME
INNER JOIN INFORMATION_SCHEMA.TABLE_CONSTRAINTS PK
    ON C.UNIQUE_CONSTRAINT_NAME = PK.CONSTRAINT_NAME
INNER JOIN INFORMATION_SCHEMA.KEY_COLUMN_USAGE CU
    ON C.CONSTRAINT_NAME = CU.CONSTRAINT_NAME
INNER JOIN (
            SELECT
                i1.TABLE_NAME,
                i2.COLUMN_NAME
            FROM
                INFORMATION_SCHEMA.TABLE_CONSTRAINTS AS i1
            INNER JOIN INFORMATION_SCHEMA.KEY_COLUMN_USAGE AS i2
                ON i1.CONSTRAINT_NAME = i2.CONSTRAINT_NAME
            WHERE
                i1.CONSTRAINT_TYPE = 'PRIMARY KEY'
           ) PT
    ON PT.TABLE_NAME = PK.TABLE_NAME
WHERE FK.CONSTRAINT_TYPE = 'FOREIGN KEY'
) AS sub
WHERE sub.PK_Table <> 'DocumentType' AND sub.PK_Table NOT LIKE 'C!_%' ESCAPE '!' AND sub.FK_Table NOT LIKE 'C!_%' ESCAPE '!' AND sub.PK_Table <> 'Document' AND sub.FK_Table <> 'Document'
ORDER BY sub.FK_Len DESC
---------------------------------------------------------------------------------------------------------------------------------------
DECLARE @sql AS NVARCHAR(MAX) = N'';
SELECT @sql +='
ALTER TABLE dbo.['+FK_Table+']
DROP CONSTRAINT ['+Constraint_Name+']
'
FROM #temp
EXEC (@sql)
