DECLARE @sql2 AS NVARCHAR(MAX) = N''
SELECT @sql2 +='
ALTER TABLE dbo.['+FK_Table+']
ADD CONSTRAINT ['+Constraint_Name+'] FOREIGN KEY ('+FK_Column+') REFERENCES dbo.['+PK_Table+']('+PK_Column+') ON DELETE CASCADE
'
FROM (
SELECT ID ,
       FK_Table ,
       FK_Column ,
       PK_Table ,
       PK_Column ,
       Constraint_Name , 
	   ROW_NUMBER() OVER(PARTITION BY FK_Table , PK_Table ORDER BY ID) AS rnmb
FROM dbo.AllFKs
) AS sub
WHERE sub.rnmb = 1 AND sub.FK_Table <> 'DE_PoliceCaseArrest' AND sub.PK_Table <> 'DocumentType' AND sub.PK_Table NOT LIKE 'C!_%' ESCAPE '!' AND sub.FK_Table NOT LIKE 'C!_%' ESCAPE '!' AND sub.PK_Table <> 'Document' AND sub.FK_Table <> 'Document'
ORDER BY sub.ID
EXEC (@sql2)
GO



